    return (
        <>
            <Button
                sx={{
                    color: "white",
                    backgroundColor: "black",
                    borderRadius: 5,
                    px: 5,
                    py: 2,
                    fontStyle: "Inter",
                    fontSize: 22,
                    '&:hover': {
                        backgroundColor: 'white',
                        color: 'black',
                        border:"1px solid black"
                    }
                }}
                endIcon="">
                Apply to 2023-2024 ASES Bootcamp today
            </Button>
        </>
    );
};

export default LongButtonCustomized;
